// Import
import React from "react";

// Functional Component
const ServiceAndParts = () => {
    return(
        <div className="service-container">
            <h1 className="service-header">Service and Parts</h1>
            <p className="service-text">At our dealership, we offer a wide range of services to keep your vehicle running smoothly. From routine maintenance to major repairs, our certified technicians are equipped to handle all of your automotive needs. We use only the highest quality parts and equipment to ensure that your vehicle is fixed right the first time. Trust us to keep you on the road safely and efficiently.</p>
            <img src="https://pr0.nicelocal.co.uk/W0N5FNEg-l5EqY_IGNX8sA/1120x700,q85/4px-BW84_n0QJGVPszge3NRBsKw-2VcOifrJIjPYFYkOtaCZxxXQ2WqVxdZgwo7KZdsT5GXEszJupa4UrmDorEkP5gobynVDnc4YjVDnUNmhRRgBU2CAgw"></img>
        </div>
    )

};

// Export
export default ServiceAndParts;

